contracts/Award.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SafeMath.sol";
import "./Search.sol";


contract addTest2 {
    using SafeMath for uint;

    using Search for uint[];

    uint[] data;

    function push(uint value) public  {
        data.push(value);
    }

    function replace(uint _old,uint _new) public  {
        uint index = data.indexOf(_old);
        if(index == uint(500)){
            data.push(_new);
        }else {
            data[index] = _new;
        }
    }

    function add(uint x,uint y) public pure returns(uint) {
        return x.addmod(y);
    }
}

contracts/Search.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library Search {

    function indexOf(uint[] storage self,uint value) public view returns(uint) {
        for(uint i = 0; i < self.length; i++){
            if (self[i] == value) return i;
        }
        return uint(500);
    }
}

contracts/SafeMath.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;


library SafeMath {

    function addmod(uint x, uint y)internal pure returns(uint) {
        uint c = x + y;
        require(c >= x, "SafeMath: addition overflow");
        return c;
    }
}

contract addTest {
    function add(uint x,uint y) public pure returns(uint) {
        return SafeMath.addmod(x, y);
    }
}

